import "./App.css";
import Profile from "./components/Profile";


function App() {
  return (
    <div className="container mt-5">
      <h2>React Add Form Data to Table Component Example</h2>
      <Profile />
      <Table/>
      <Form/>
    </div>
  );

}

export default App;
